import React from 'react';
import './AboutContent.css';
import { data } from '../data/data';

function AboutContent() {  
  return (
    <section className="about" id="about">
      <h3>
        Sobre n√≥s
      </h3>
      {
        data.map((e) => (
          <article
          className="resume"
          key={e.id}>
            <div className='inner'>
            <h2
            type="button">
              {e.title}
            </h2>
            </div>
            <div className='back'>
            <p>
              {e.content}
              </p>
            </div>
          </article>
        ))
      }
    </section>
  );
}

export default AboutContent;
